import React from "react";
import profileStyles from "./profile.module.css";
import { NavLink, Routes, Route, Outlet } from "react-router-dom";
import ProfileForm from "../components/ProfileForm/ProfileForm";
import Orders from "../components/Orders/Orders";

function Profile() {
  return (
    <div className={profileStyles.container}>
      <div className={profileStyles.nav}>
        <NavLink to="" className={({ isActive }) => (isActive ? profileStyles.activeLink : profileStyles.link)}>
          Профиль
        </NavLink>
        <NavLink to="orders" className="text text_type_main-medium">
          История заказов
        </NavLink>
        <NavLink to="orders/:id" className="text text_type_main-medium">
          Выход
        </NavLink>
        <span className="text text_type_main-default text_color_inactive">В этом разделе вы можете изменить свои персональные данные</span>
      </div>
      <div className={profileStyles.content}>
        <Outlet />
      </div>
    </div>
  );
}

export default Profile;
